import React, { useState } from 'react';
import "./Navbar.css";

function Navbar() {

    return (
        <div className="div">
            <ul className="navbar">
                <li className="box"><button onClick={() => props.onFunction("home")}>Home</button></li>
                <li className="box"><button onClick={() => props.onFunction("bio")}>Bio</button></li>
                <li className="box"><button onClick={() => props.onFunction("education")}>Education</button></li>
                <li className="box"><button onClick={() => props.onFunction("projects")}>Projects</button></li>
                <li className="box"><button onClick={() => props.onFunction("professional")}>Professional</button></li>
            </ul>

        </div>
    )
}

export default Navbar;
